'use strict';

import test from 'tape';

import E from '../';
import R from '../range';
import Ref from '../ref';
import S from '../syntax';
import T from '../type';

test('errors', function (t) {
	t.equal(E, Error);
	t.equal(R, RangeError);
	t.equal(Ref, ReferenceError);
	t.equal(S, SyntaxError);
	t.equal(T, TypeError);

	t.end();
});
